description:
Bán nhanh nhà C4 tại Đặng Xá, Gia Lâm, Hà Nội:
- Lô góc 2 mặt đường;
- Dt 50m2, mt 5m;
- ĐƯờng trước siêu rộng trải nhựa có vỉa hè, oto tránh;
- Trục chính kinh doanh siêu tốt;
- View hồ mát mẻ thoáng;
- Ngay sát trường cọc các cấp;
- Sổ hồng sang tên;
- Giá siêu đẹp chỉ tròn 4 tỷ
LH em qua sdt/zalo để xem 24/7
